import React from 'react';
import { NavLink } from 'react-router-dom'

const Nav = (props) => {

  return (
    <nav className="main-nav">
      <ul>
        <li><NavLink to='/cats'>Computers</NavLink></li>
        <li><NavLink to='/dogs'>Cats</NavLink></li>
        <li><NavLink to='/computers'>Dogs</NavLink></li>
      </ul>
    </nav>
  )
}


export default Nav
